import React, { useState }  from 'react';





const App = ()=>{
    let time = new Date().toLocaleTimeString()
    let [currentD, updateD] = useState(time)

    
const Clicked = () =>{


    updateD(currentD+ time)
 }
 
    return(
        <>
        <h1>{currentD}</h1>
        <button onClick= {Clicked}>Click</button>
        </>
    )
}


export default App;
